@Dududu9991 @Public_Citizen @Stanford @Columbia No. I will carry on as I will. 
I'm doing great. It's you who orders strangers around and acts as if you know whereof you speak. 

We're done here. Go bully somewhere else.

@Dududu9991 @Public_Citizen @Stanford @Columbia Again with such vitriol towards a perfect stranger. And you could not be more wrong.

I AM a Stanford PICU mom. I would gladly pay all the money of my lifetime not to be. It defines me. Saying so identifies me to other parents of seriously ill children. 

Check yourself.
